FEMALE (
allotype
): Total length 2.65. Book lung covers elliptical, anterolateral edge tuberculate. Dorsal scutum anterior half without projecting denticles. Spine formula: tibia I v4-4-2, metatarsus I v2-2-2; tibia II v4-4-0, metatarsus II v3-3-0; tibia III p1-1-0, v0-1-0, metatarsus III p1-0-1, v0-1-0. Epigynal atrium narrow, with tubular median element, placed anteriorly in our preparations (fig. 102).
